import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insurance", amount: 500, date: new Date(2022, 8, 23) },

    { title: "Bike Insurance", amount: 300, date: new Date(2022, 8, 23) },

    { title: "House Insurance", amount: 2500, date: new Date(2022, 8, 23) },

    { title: "Company Insurance", amount: 5000, date: new Date(2022, 8, 23) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>{" "}
